// Searchbox
document.querySelector(".lp-search")?.addEventListener("click", function () {
    this.classList.add("lp-search-open");
});
const lpSearch = document.querySelector(".lp-search");
window.addEventListener("click", function (e) {
    if (lpSearch &&
        e.target instanceof Node &&
        !lpSearch.contains(e.target)) {
        lpSearch?.classList.remove("lp-search-open");
    }
});
const lpSearchBox = document.querySelector(".lp-search-box");
lpSearchIcon?.addEventListener("click", function () {
    lpSearchBox.value = "";
});
