// Variables
const smIcons1 = document.querySelectorAll(".sm-icon1");
const smIcons2 = document.querySelectorAll(".sm-icon2");
const smIcons3 = document.querySelectorAll(".sm-icon3");
const smSec9Icon = document.querySelectorAll(".sm-section9 .sm-icon");
// Insert icons into the divs
smIcons1.forEach(function (icon1) {
    icon1.innerHTML = instaIcon;
});
smIcons2.forEach(function (icon2) {
    icon2.innerHTML = phoneIcon2;
});
smIcons3.forEach(function (icon3) {
    icon3.innerHTML = pinIcon;
});
// Add a background element to the specific section's child divs (for the animation)
// Add "bubble" elements
smSec9Icon.forEach(function (icon) {
    let smBg = document.createElement("div");
    smBg.classList.add("sm-background");
    icon.appendChild(smBg);
    for (let i = 1; i <= 6; i++) {
        let bubble = document.createElement("div");
        bubble.classList.add("sm-bubble");
        bubble.classList.add("sm-bubble" + i);
        icon.appendChild(bubble);
    }
});
